In recent years Python ecosystem evolved significantly. From using requirements.txt to dependency management tools like Poetry, from simple typing to Protocols [1] and Variadic Generics [2]. We&#x27;ve got walrus operator, match case statement, and finally even faster Python. More and more low-level libraries are being written in Rust [3].<p>What new features, tools, libraries (already implemented or being worked on) are the most useful for your work with Python? What are you the most excited about?<p>[1] https:&#x2F;&#x2F;peps.python.org&#x2F;pep-0544&#x2F;
[2] https:&#x2F;&#x2F;peps.python.org&#x2F;pep-0646&#x2F;
[3] https:&#x2F;&#x2F;github.com&#x2F;pydantic&#x2F;pydantic-core
